import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [users, setUsers] = useState([]);
  const [search, setSearch] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/api/users")
      .then(res => res.json())
      .then(data => {
        const usersWithRankedPreferences = data.map(u => {
          let rankedPrefs = [];
          if (u.preferences && u.preferences.length > 0) {
            const counts = {};
            u.preferences.forEach(p => counts[p] = (counts[p] || 0) + 1);
            rankedPrefs = Object.keys(counts)
              .sort((a, b) => counts[b] - counts[a]);
          }
          return { id: u.id, username: u.username, email: u.email, rankedPreferences: rankedPrefs };
        });
        setUsers(usersWithRankedPreferences);
      })
      .catch(err => console.error("Error fetching users:", err));
  }, []);

  const filteredUsers = users.filter(u => u.username.toLowerCase().includes(search.toLowerCase()));

  return (
    <div style={{ marginLeft: 220, padding: 20 }}>
      <h2>Admin Preferences</h2>
      <input
        placeholder="Search user..."
        value={search}
        onChange={e => setSearch(e.target.value)}
        style={{ padding: 6, marginBottom: 16 }}
      />
      <table style={{ width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr>
            <th style={{ border: "1px solid #ccc", padding: 8 }}>Username</th>
            <th style={{ border: "1px solid #ccc", padding: 8 }}>Email</th>
            <th style={{ border: "1px solid #ccc", padding: 8 }}>Preferences (Ranked)</th>
          </tr>
        </thead>
        <tbody>
          {filteredUsers.map(u => (
            <tr key={u.id}>
              <td style={{ border: "1px solid #ccc", padding: 8 }}>{u.username}</td>
              <td style={{ border: "1px solid #ccc", padding: 8 }}>{u.email}</td>
              <td style={{ border: "1px solid #ccc", padding: 8 }}>
                {u.rankedPreferences.length > 0 ? u.rankedPreferences.join(" > ") : "-"}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
